#include <iosfwd>
#include <vector>

// -- This header must be included after others --
#include "leetcode/testing/solution_test_helper.h"

using namespace std;
using namespace lcd;

// Description of |1482. Minimum Number of Days to Make m Bouquets|:
//
// You are given an integer array |bloomDay|, an integer |m| and an integer |k|.
// You want to make |m| bouquets. To make a bouquet, you need to use |k|
// adjacent flowers from the garden. The garden consists of |n| flowers, the
// |iᵗʰ| flower will bloom in the |bloomDay[i]| and then can be used in exactly
// one bouquet. Return the minimum number of days you need to wait to be able to
// make |m| bouquets from the garden. If it is impossible to make m bouquets
// return |-1|.
//

LEETCODE_BEGIN_RESOLVING(1482, MinimumNumberOfDaysToMakeMBouquets, Solution);

class Solution {
private:
  bool helper(vector<int> &days, int mid, int m, int k) {
    int b = 0, f = 0;
    for (auto &x : days) {
      if (x <= mid) {
        ++f;
      } else {
        f = 0;
      }

      if (f == k) {
        ++b;
        f = 0;
        if (b == m) {
          return true;
        }
      }
    }
    return false;
  }

public:
  int minDays(vector<int> &bloomDay, int m, int k) {
    if ((int64_t)(m)*k > bloomDay.size()) {

      return -1;
    }

    int lo = 1e9 + 1, hi = 0;

    for (auto &x : bloomDay) {
      lo = min(lo, x);
      hi = max(hi, x);
    }

    while (lo <= hi) {
      int mid = lo + (hi - lo) / 2;
      if (helper(bloomDay, mid, m, k)) {
        hi = mid - 1;
      } else {
        lo = mid + 1;
      }
    }

    return hi + 1;
  }
};

LEETCODE_END_RESOLVING(Solution);

